import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the "Sort by" select using label text as anchor (different from previous attempts)
    await page.waitForSelector('label[for="sortSelect"]', { timeout: 5000 });

    // Use XPath to find the select element that follows the "Sort by:" label
    const sortSelectHandle = await page.waitForSelector(
      '//label[contains(text(),"Sort by")]/following-sibling::select[1]',
      { timeout: 5000 }
    );

    // If not found by XPath, fallback to select#sortSelect
    let selectHandle = sortSelectHandle;
    if (!selectHandle) {
      selectHandle = await page.waitForSelector('select#sortSelect', { timeout: 5000 });
    }

    // Change sort to "Price: Low to High" (option value: "price-low")
    await selectHandle.selectOption('price-low');

    // Wait for the products grid/list to update (look for a product card)
    await page.waitForSelector('.product-card, .product-card-list', { timeout: 5000 });

    // Take screenshot after sort applied
    const step2 = path.join(screenshotsDir, 'step_2_sort_applied.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Extract the titles and prices of the first 3 products to verify sort
    const products = await page.$$eval(
      '.product-card, .product-card-list',
      nodes => nodes.slice(0, 3).map(node => {
        const title = node.querySelector('.product-title')?.textContent?.trim() || '';
        const priceText = node.querySelector('.product-price')?.textContent || '';
        const priceMatch = priceText.match(/\$([0-9.,]+)/);
        const price = priceMatch ? parseFloat(priceMatch[1].replace(/,/g, '')) : null;
        return { title, price };
      })
    );

    return {
      success: true,
      action: "Applied 'Price: Low to High' sort filter using XPath and verified product order.",
      extractedData: {
        firstThreeProducts: products
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
